import React, {Component} from "react";
import moment from 'moment';
import { connect } from "react-redux";


import { retrieveCustomer } from "../../../store/customer_slice";
import { retrieveInvoice } from "../../../store/invoice_slice";
import { findOrderLineByOrderID } from "../../../store/orderline_slice";
import { retrieveOrder } from "../../../store/order_slice";


class OrderCard extends Component {
	constructor(props) {
	  super(props);

	  this.handleOnClick = this.handleOnClick.bind(this);
	  this.getCustomerData = this.getCustomerData.bind(this);
	  this.getInvoiceData = this.getInvoiceData.bind(this);
	  this.findOrderLinesByID = this.findOrderLinesByID.bind(this);

	  this.state = {
		firstName: "",
		lastName: "",
		referenceNumber: "",

		invoiceNumber: "NA",
		numberOfLogs: 0,
		datePlaced: '2022-01-17T05:00:00.000Z',

		cardIDs: {
			orderId: -1,
			customerId: -1,
		}

	 };
	}

	handleOnClick(data) {
		this.props.orderCardOnClick(data)
	}


	componentDidMount() {
        this.props.retrieveProducts();
		const {orderID, referenceNumber, datePlaced, orderStatus, trackingNumber, giftFor, giftMessage, isGift, customerId, shippingId} = this.props.order
		this.setState({
			orderID: parseInt(orderID),
			activeOrder: {
				referenceNumber: referenceNumber,
				datePlaced: datePlaced,
				orderStatus: orderStatus,
				trackingNumber: trackingNumber,
				giftFor: giftFor,
				giftMessage: giftMessage,
				isGift: isGift,
				customerId: customerId,
				shippingId: shippingId,
			}
		})
		this.getShippingInfo(shippingId, customerId);
		this.getInvoiceData(orderID);


	}

	getShippingInfo(shippingId, customerId) {
        this.props
			.retrieveShippingAddress({id: shippingId})
			.then((data) => {
				this.setState({
					activeAddress: {
						streetAddressOne: data.payload.streetAddressOne,
						streetAddressTwo: data.payload.streetAddressTwo,
						city: data.payload.city,
						state: data.payload.state,
						zip: data.payload.zip,
					}
				});
				console.log(data);
				this.getCustomerData(customerId);
			})
			.catch((e) => {
				console.log(e);
			});
	}

	getCustomerData(id) {
		const {orderID} = this.state

		this.props
			.retrieveCustomer({id})
			.then((data) => {
				console.log(data);
				this.setState({
                    activeCustomer: {
						firstName: data.payload.firstName,
						lastName: data.payload.lastName,
						email: data.payload.email,
						phoneNumber: data.payload.phoneNumber,
					} 
				});
				this.findOrderLinesByID(orderID);
			})
			.catch((e) => {
			console.log(e);
			});
	}

	findOrderLinesByID(id) {
		this.props
			.findOrderLineByOrderID({ id })
			.then((data) => {
				console.log(data);

				let i = 0;
				let logs = 0;
                let flavors = data.payload.length;
				while (i < flavors) {
                    const newProduct = {
                        lineOrderID: data.payload[i].lineOrderID,
                        lineProductID: data.payload[i].lineProductID,
                        qtyOrdered: data.payload[i].qtyOrdered,
                    }

                    const list = this.state.productsOrdered.slice()
                    this.setProductsOrdered([...list, newProduct])		

                    logs+= data.payload[i].qtyOrdered;
					console.log(data.payload[i]);
					i++;

				}

				this.setState({
					numberOfLogs: logs,
                    numberOfFlavors: flavors
				});

				this.getInvoiceData(id);
			})
			.catch((e) => {
				console.log(e);
			});
	}


	getInvoiceData(id) {
		this.props
			.retrieveInvoice({id})
			.then((data) => {
				console.log(data);
				this.setState({
					activeInvoice: {
						invoiceNumber: data.payload.invoiceNumber,
						revenue: data.payload.revenue,
						expense: data.payload.expense,
						isPaid: data.payload.isPaid,
					}
				});
			})
			.catch((e) => {
			console.log(e);
			});
	}

    setProductsOrdered(products) {
		this.setState({
			productsOrdered: products
		});
	}
	render() {
		const {order} = this.props;


		const {firstName, lastName, invoiceNumber, numberOfLogs, datePlaced} = this.state;

		const existingOrderData = {
			order: order,
			lastName: lastName
		}

		return (
			<div className='OrderCard' onClick={() => this.handleOnClick(existingOrderData)}>
				<div className='OrderCardHeader' style={{ backgroundColor: this.props.color }}>
					<h4 style={{ fontWeight: 'bold' }}>{lastName}, {firstName}</h4>
				</div>

				<div className='OrderCardContent'>
					<h4>Reference: {order.referenceNumber}</h4>
					<h4>Invoice: {(invoiceNumber === undefined) ? 'NA' : invoiceNumber}</h4>
					<h4>Logs Ordered: {numberOfLogs}</h4>
					<h4>Date Placed: {moment(datePlaced).format('MM/DD/YYYY')}</h4>
				</div>	
			</div>
		);	
	}
  }


  // Mapping only the parts of the redux store that we want to work with on this component
  const mapStateToProps = (state) => {	
	return {
		shippingAddresses: state.shippingAddresses,
		customers: state.customers,
		invoices: state.invoices,
		orderline: state.orderline,
		products: state.products
	};
  };

export default connect(mapStateToProps, { retrieveCustomer, findOrderLineByOrderID, retrieveInvoice })(OrderCard);
